<script nonce="veN8rc-ZhpPQNuWenecesg">
// 更安全的 getEnv 实现 —— 不用 eval，不覆盖原始全局对象，结果保存在 window.__proxies
let getEnv = (proxy_array) => {
  window.__proxies = window.__proxies || {};
  window.__proxyLog = window.__proxyLog || [];

  for (let i = 0; i < proxy_array.length; i++) {
    const name = proxy_array[i];
    let target;
    try {
      // 通过全局 this/globalThis 获取对象
      target = globalThis[name];
    } catch (e) {
      target = undefined;
    }

    // 用一个可读的标识
    const label = name;

    // 只有存在可代理的对象才尝试
    if (typeof target === 'object' || typeof target === 'function') {
      const handler = {
        get(targetObj, property, receiver) {
          try {
            const info = {
              method: 'get',
              object: label,
              property: String(property),
              propType: typeof property,
              valueType: typeof targetObj[property],
              time: Date.now()
            };
            window.__proxyLog.push(info);
            // 可把日志打印到 console（可注释掉以免太多输出）
            console.log('Proxy GET', info);
          } catch (e) {}
          // 注意：尽量用 Reflect.get 保持原行为
          return Reflect.get(targetObj, property, receiver);
        },
        set(targetObj, property, value, receiver) {
          try {
            const info = {
              method: 'set',
              object: label,
              property: String(property),
              propType: typeof property,
              valueType: typeof targetObj[property],
              newValueType: typeof value,
              time: Date.now()
            };
            window.__proxyLog.push(info);
            console.log('Proxy SET', info);
          } catch (e) {}
          return Reflect.set(targetObj, property, value, receiver);
        },
        // 可根据需要再实现 apply/construct/has 等陷阱
      };

      // 创建代理，但**不直接覆盖 globalThis[name]（以免失败/破坏页面）**
      try {
        const proxy = new Proxy(target, handler);
        // 保存到 window.__proxies 下，页面脚本不会自动使用它，
        // 但你可以在控制台手动用 window.__proxies['document'] 来操作并观察行为
        window.__proxies[name] = { ok: true, proxy: proxy, original: target };
        console.log(`Created proxy for ${name}`, window.__proxies[name]);
      } catch (e) {
        window.__proxies[name] = { ok: false, error: String(e) };
        console.warn(`Failed to proxy ${name}:`, e);
      }

    } else {
      // 对象不存在或不是可代理类型
      window.__proxies[name] = { ok: false, reason: 'not found or not object/function' };
      console.warn(`Skip proxy for ${name}, not found or not object/function`);
    }
  }
};

// 调用示例（不会覆盖 window/document）
const proxy_array = ['window', 'document', 'location', 'navigator', 'history','screen','target'];
getEnv(proxy_array);

// 之后你可以查看 window.__proxies 和 window.__proxyLog
console.log(window.__proxies);
console.log(window.__proxyLog.slice(-20));

</script>
